{"negative":{"rating":1,"review":"The candle is amazing, but please get it from Amazon or directly from Yankee's store. 
I ordered it via shipping and they used FedEx, the candle came fully broken and the glass shards were scattered everywhere in the box and given that the box wasn't sealed they were also leaking out through the edges of the cardboard. 

When I went to get help, they recommended returning it to the store which is like a 1hr drive from my place-- ended up getting a refund by calling them. But please just avoid the hassle if you can xx"},"positive":{"rating":5,"review":"Yankee candles smell so much better than other brands. The smell is not so strong. It's nice and pleasant.  This pink one has a nice smell . Hard to describe . Basically like a mild perfume"}}

{"negative":{"rating":2,"review":"This feather duvet in cotton white solid offers excellent comfort and a stylish appearance, enhancing the overall bedroom aesthetic. However, it's worth noting that it produces noticeable noise when you move, which might be a consideration for those sensitive to sound disturbances. 

I would buy it again, knowing it makes noise similar to garbage bags in the middle of the night when you move? Definitely not."},"positive":{"rating":5,"review":"I recently spent a week at a 5 star resort and never slept so good. I quickly recreated the sleeping environment in my own home and now I'll always be on vacation! 
In the pic I pulled out the corner to verify the comforter is in the duvet. The comforter has loops for ties to secure the duvet in place which is helpful for keeping it from bunching up somewhere. My feet love it! It is lightweight and breathes with the room thermostat. Paradise!"}}

{"negative":{"rating":1,"review":"The Fall candy mix should not be sent in extreme.  It arrived in a lump.  I tried to separate the candies but, you can not tell a pumpkin from a candy corn.  I have not opened the skittles yet to check them.  Please reconsider how candy of any kind is shipped."},"positive":{"rating":4,"review":"I love Brach's candy corn and pumpkins, but their Autumn Mix USED to also contain brown maple leaves which had a maple flavor and I believe yellow ears of corn; what happened to those???

THAT was the Autumn Mix I remember and love and that's why I gave this candy 4 and not 5 stars.

Of course ANY candy by Brach's is good!"}}

{"negative":{},"positive":{"rating":5,"review":"[This review was collected as part of a promotion.] I'm so impressed with this Aireolux 800 thread count sheet set. The queen set comes with 1 flat sheet, 1 fitted sheet and 2 standard pillowcases. They are so soft and high quality. The fitted sheet has elastic all around with deep pockets so it fits the mattress and stays put. They still looked nice right out of the washer and dryer. 

The set come beautifully packaged. The white box is tied with a pretty ribbon. When you open the box, the set is wrapped with another ribbon. This set would make a beautiful wedding gift. It's excellent quality and makes me feel like I'm at an expensive hotel. 

I'd definitely purchase another set and recommend then to my family and friends."}}

